import logo from './logo.svg';
import './App.css';

const title = 'Jarom';

function App() {
  return (
    <div>
      <h1>Hello, {title}</h1>

      <label htmlFor="search">Seearch: </label>
      <input id="search" type="text" />
    </div>
  );
}

export default App;
